import React from "react";
import { connect } from "react-redux";
import axios from "axios";

class TesFu extends React.Component {
  constructor() {
    super();
    this.state = { name: "" };
  }
  fun = async () => {
    // const dd = await axios.get("http://localhost:5000", {
